The fix uses a PreparedStatement instead of a regular Statement, replacing the concatenated SQL string with a parameterized query. This prevents SQL injection by properly escaping user input.
```suggestion
// Import java.sql.PreparedStatement for using prepared statements
    // This helps prevent SQL injection by separating SQL logic from data
    import java.sql.PreparedStatement;

    public void executeSqlStatementNoncompliant(HttpServletRequest request, java.sql.Connection connection) {
        final String favoriteColor = request.getParameter("favoriteColor");
        try {
            String sql = "SELECT * FROM people WHERE favorite_color=?";
            PreparedStatement statement = connection.prepareStatement(sql);
            statement.setString(1, favoriteColor);
            // Compliant: user-given input is now sanitized before use.
            statement.execute();
        } catch (java.sql.SQLException e) {
            throw new RuntimeException(e);
        }
